"use strict";(self.webpackChunkaureole=self.webpackChunkaureole||[]).push([[135],{8888:(n,s,a)=>{a.r(s),a.d(s,{data:()=>e});const e={key:"v-7cecb35c",path:"/config/id_manager.html",title:"Identity менеджер",lang:"en-US",frontmatter:{},excerpt:"",headers:[{level:2,title:"Конфигурация jwt webhook identity менеджера.",slug:"конфигурация-jwt-webhook-identity-менеджера",children:[{level:3,title:"Пример конфига",slug:"пример-конфига",children:[]}]},{level:2,title:"Конфигурация standard менеджера.",slug:"конфигурация-standard-менеджера",children:[{level:3,title:"Пример конфига",slug:"пример-конфига-1",children:[]}]}],filePathRelative:"config/id_manager.md",git:{contributors:[{name:"asaevich",email:"semen.asaevich@gmail.com",commits:1}]}}},3650:(n,s,a)=>{a.r(s),a.d(s,{default:()=>o});const e=(0,a(6252).uE)('<h1 id="identity-менеджер" tabindex="-1"><a class="header-anchor" href="#identity-менеджер" aria-hidden="true">#</a> Identity менеджер</h1><hr><p>Описывает все свойства данного identity менеджера. Плагин берет на себя роль взаимодействия с БД и предоставляет ряд методов для получения и сохранения данных пользователя.</p><ul><li>Тип: <strong>object</strong>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <h4 id="допустим-один-из-вариантов-конфига" tabindex="-1"><a class="header-anchor" href="#допустим-один-из-вариантов-конфига" aria-hidden="true">#</a> Допустим один из вариантов конфига</h4><h2 id="конфигурация-jwt-webhook-identity-менеджера" tabindex="-1"><a class="header-anchor" href="#конфигурация-jwt-webhook-identity-менеджера" aria-hidden="true">#</a> Конфигурация jwt webhook identity менеджера.</h2><ul><li>Тип: <strong>object</strong>. Конфигурация jwt webhook identity менеджера. Служит для задания свойств менеджера. Обязательны: <code>type</code>, <code>config</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>type</code>: Константа: <strong>jwt_webhook</strong>. Тип менеджера. Необходим, чтобы дать Aureole понять, какой из менеджеров использовать.</li><li><code>config</code>: Тип: <strong>object</strong>. Конфигурация identity менеджера. Описывает все свойства данного менеджера. Обязательны: <code>address</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>address</code>: Тип: <strong>string</strong>. Дополнительно: Абсолютный URL-адрес. Адрес сервера. Хост и порт сервера, к которому будет обращаться плагин.</li><li><code>retries_num</code>: Тип: <strong>integer</strong>. Количество повторений запроса. Максимальное количество повторений запроса, которое будет совершать плагин в случае возникновения ошибки. Минимальное значение: <strong>1</strong>.</li><li><code>retry_interval</code>: Тип: <strong>integer</strong>. Дополнительно: Единицы измерения: ms. Интервал между запросами. Время, которое будет ждать плагин, перед тем, как совершить очередную попытку сделать запрос. Минимальное значение: <strong>1</strong>.</li><li><code>timeout</code>: Тип: <strong>integer</strong>. Дополнительно: Единицы измерения: ms. Время ожидания ответа от сервера. Максимальное время ожидание ответа, по истечению которого, плагин перестанет ждать ответа. Минимальное значение: <strong>1</strong>.</li><li><code>headers</code>: Тип: <strong>object</strong>. Перечисление заголовков. Заголовки, которые будут приложены к запросу. <ul><li><code>.*</code>: Тип: <strong>string</strong>.</li></ul></li></ul></li></ul><h3 id="пример-конфига" tabindex="-1"><a class="header-anchor" href="#пример-конфига" aria-hidden="true">#</a> Пример конфига</h3><div class="language-yaml ext-yml line-numbers-mode"><pre class="language-yaml"><code><span class="token key atrule">id_managers</span><span class="token punctuation">:</span>\n  <span class="token punctuation">-</span> <span class="token key atrule">type</span><span class="token punctuation">:</span> <span class="token string">&quot;jwt_webhook&quot;</span>\n    <span class="token key atrule">name</span><span class="token punctuation">:</span> webhook_identity\n    <span class="token key atrule">config</span><span class="token punctuation">:</span>\n      <span class="token key atrule">address</span><span class="token punctuation">:</span> http<span class="token punctuation">:</span>//localhost<span class="token punctuation">:</span><span class="token number">3001</span>\n      <span class="token key atrule">retries_num</span><span class="token punctuation">:</span> <span class="token number">1</span>\n      <span class="token key atrule">retry_interval</span><span class="token punctuation">:</span> <span class="token number">2</span>\n      <span class="token key atrule">timeout</span><span class="token punctuation">:</span> <span class="token number">10</span>\n      <span class="token key atrule">headers</span><span class="token punctuation">:</span>\n        <span class="token key atrule">header1</span><span class="token punctuation">:</span> value1\n        <span class="token key atrule">header2</span><span class="token punctuation">:</span> value2\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br></div></div></li></ul><h2 id="конфигурация-standard-менеджера" tabindex="-1"><a class="header-anchor" href="#конфигурация-standard-менеджера" aria-hidden="true">#</a> Конфигурация standard менеджера.</h2><ul><li>Тип: <strong>object</strong>. Конфигурация standard менеджера. Служит для задания свойств менеджера. Обязательны: <code>type</code>, <code>config</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>type</code>: Константа: <strong>standard</strong>. Тип менеджера. Необходим, чтобы дать Aureole понять, какой из менеджеров использовать.</li><li><code>config</code>: Тип: <strong>object</strong>. Конфигурация identity менеджера. Описывает все свойства данного менеджера. Обязательны: <code>db_url</code>. Наличие дополнительных свойств: <strong>Недопустимо</strong>. <ul><li><code>db_url</code>: Тип: <strong>string</strong>. URL для подклчючения к БД. По этому URl-у плагин будет совершать подключения к БД. Минимальная длина: <strong>1</strong>.</li></ul></li></ul><h3 id="пример-конфига-1" tabindex="-1"><a class="header-anchor" href="#пример-конфига-1" aria-hidden="true">#</a> Пример конфига</h3><div class="language-yaml ext-yml line-numbers-mode"><pre class="language-yaml"><code><span class="token key atrule">id_managers</span><span class="token punctuation">:</span>\n  <span class="token punctuation">-</span> <span class="token key atrule">type</span><span class="token punctuation">:</span> <span class="token string">&quot;standard&quot;</span>\n    <span class="token key atrule">name</span><span class="token punctuation">:</span> standard\n    <span class="token key atrule">config</span><span class="token punctuation">:</span>\n      <span class="token key atrule">db_url</span><span class="token punctuation">:</span> postgresql<span class="token punctuation">:</span>//root<span class="token punctuation">:</span>password@localhost<span class="token punctuation">:</span>5432/aureole\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div></li></ul></li></ul>',4),t={},o=(0,a(3744).Z)(t,[["render",function(n,s){return e}]])},3744:(n,s)=>{s.Z=(n,s)=>{for(const[a,e]of s)n[a]=e;return n}}}]);